Blackpool Council, Leisure Services are seeking a partnership with an external branding, marketing and business support company.  
The successful company will be required to;
•	Deliver on-going marketing campaigns; 
•	Provide on-going marketing support for Blackpool Council's three leisure facilities and the outdoor activities service;
•	Work with the leisure team to up-skill officers in the successful marketing of their services;
•	Provide business development support focused on growing the 'Learn to Swim' scheme and the health and fitness offer across the service to realise significant income growth in both areas.

Assignment under the Market Research Framework MR130001.

This qualitative research will look to explore responses to the new letter notifying customers that their tax credits debts are being transferred to DWP for recovery. In particular, it will seek to:
•	Walk through the end to end journey with customers to explore their likely reactions at each stage;
•	Ensure the messages in the letter are clear and unambiguous;
•	Find out what questions people have once they have read the letter and test this alongside the draft web guidance to identify gaps.
